import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Yousef',
          id: 'buddy1'
        },
        {
          name: 'Doun',
          id: 'buddy2'
        },
        {
          name: 'Khaos',
          id: 'buddy3'
        }
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monster => (
            <h1 key={monster.id}> { monster.name } </h1>)
          )}
      </div>
    );
  }
}

export default App;
